//gsap animation on click of #start-btn:
function startGame() {
    gsap.to("#leftGate", {
      duration: 1.2,
      scaleX: 0.1,
      skewY: -20,
      opacity: 0.4,
      ease: "power2.out",
    })

    gsap.to("#rightGate", {
      duration: 1.2,
      scaleX: 0.1,
      skewY: 20,
      opacity: 0.4,
      ease: "power2.out",
//      onComplete: () => {
//      gameStart()
//      }
    })
}

